import React, { Component } from 'react';
import Cards from 'components/cards.jsx'


class CourseHome extends Component {
    constructor(props) {
        super(props);
        this.state = {
            data: [{
                "userId": "card 1",
                "id": 1,
                "title": "delectus aut autem",
                "completed": false,
                "linked" :"maincardview",
                "Agent":"Osama Ahmed Tahir"
            },{
                "userId": "card 2",
                "id": 1,
                "title": "delectus aut autem",
                "completed": false,
                "linked" :"maincardview",
                "Agent":"Ali Jasim"
            },{
                "userId": "card 3",
                "id": 1,
                "title": "delectus aut autem",
                "completed": false,
                "linked" :"maincardview",
                "Agent":"MukhtaBani"

            },{
                "userId": "card 4",
                "id": 1,
                "title": "delectus aut autem",
                "completed": false,
                "linked" :"maincardview",
                "Agent":"Sanchit"

            }
            ,{
                "userId": "card 5",
                "id": 1,
                "title": "delectus aut autem",
                "completed": false,
                "linked" :"maincardview",
                "Agent":"Ali"
            }],
            agents:[{
                "userId": "card 1",
                "id": 1,
                "title": "delectus aut autem",
                "completed": false,
                "linked" :"maincardview",
                "Agent":"Osama Ahmed Tahir"
            },{
                "userId": "card 2",
                "id": 1,
                "title": "delectus aut autem",
                "completed": false,
                "linked" :"maincardview",
                "Agent":"Ali Jasim"
            },{
                "userId": "card 3",
                "id": 1,
                "title": "delectus aut autem",
                "completed": false,
                "linked" :"maincardview",
                "Agent":"MukhtaBani"

            },{
                "userId": "card 4",
                "id": 1,
                "title": "delectus aut autem",
                "completed": false,
                "linked" :"maincardview",
                "Agent":"Sanchit"

            }
            ,{
                "userId": "card 5",
                "id": 1,
                "title": "delectus aut autem",
                "completed": false,
                "linked" :"maincardview",
                "Agent":"Ali"
            }]

        }
    }
  render() {
    return (
      <div className="Courses">
      <div className="container">
      <div>     
           {
             this.state.data.map((value,id) => {
                        return (
                                <Cards key={id} showButton="true" data={value} />
                        )
                    })
                }
            </div>
            </div>
      </div>
    );
  }
}

export default CourseHome;
